import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import WeatherModal from '../components/WeatherModal';

const ModuleCard = ({ title, description, image, link }) => (
  <div className="bg-white rounded-lg shadow-lg overflow-hidden transform transition-transform hover:scale-105">
    <img src={image} alt={title} className="w-full h-48 object-cover" />
    <div className="p-4">
      <h3 className="text-xl font-bold text-nature-blue mb-2">{title}</h3>
      <p className="text-gray-600 mb-4">{description}</p>
      <a
        href={link}
        className="inline-block bg-nature-green text-white px-4 py-2 rounded hover:bg-green-700 transition duration-200"
      >
        En savoir plus
      </a>
    </div>
  </div>
);

const Home = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [suggestions, setSuggestions] = useState([]);
  const [showWeather, setShowWeather] = useState(false);
  const navigate = useNavigate();

  const modules = [
    {
      title: "Techniques de pêche",
      description: "Découvrez toutes les techniques de pêche, du débutant à l'expert",
      image: "https://images.unsplash.com/photo-1544551763-46a013bb70d5?w=800",
      link: "/catalog"
    },
    {
      title: "Guide des poissons",
      description: "Identifiez les différentes espèces et leurs habitats",
      image: "https://images.unsplash.com/photo-1534043464124-3be32fe000c9?w=800",
      link: "/fish-guide"
    },
    {
      title: "Spots de pêche",
      description: "Les meilleurs endroits pour pêcher près de chez vous",
      image: "https://images.unsplash.com/photo-1515255384510-23e8b6a6ca3c?w=800",
      link: "/fishing-spots"
    }
  ];

  const handleSearch = async (e) => {
    e.preventDefault();
    if (searchTerm.trim()) {
      navigate(`/catalog?search=${encodeURIComponent(searchTerm)}`);
    }
  };

  const handleInputChange = async (e) => {
    const value = e.target.value;
    setSearchTerm(value);

    if (value.length > 2) {
      try {
        const response = await fetch(`/api/search/suggestions?q=${value}`);
        const data = await response.json();
        setSuggestions(data);
      } catch (error) {
        console.error('Error fetching suggestions:', error);
      }
    } else {
      setSuggestions([]);
    }
  };

  return (
    <div className="max-w-6xl mx-auto px-4">
      <div className="text-center mb-12">
        <h1 className="text-4xl font-bold text-nature-blue mb-4">
          Bienvenue sur PêcheMaster Pro
        </h1>
        <p className="text-xl text-gray-600">
          Votre guide virtuel pour maîtriser les techniques de pêche
        </p>
      </div>

      <div className="bg-white p-6 rounded-lg shadow-lg mb-12">
        <form onSubmit={handleSearch} className="space-y-4">
          <div className="relative">
            <input
              type="text"
              value={searchTerm}
              onChange={handleInputChange}
              placeholder="Rechercher une technique, un poisson ou un lieu..."
              className="w-full p-4 border border-gray-300 rounded-lg focus:ring-2 focus:ring-nature-blue focus:border-transparent"
            />
            {suggestions.length > 0 && (
              <div className="absolute w-full bg-white border border-gray-200 rounded-lg mt-1 shadow-lg z-10">
                {suggestions.map((suggestion, index) => (
                  <div
                    key={index}
                    className="p-2 hover:bg-gray-100 cursor-pointer"
                    onClick={() => {
                      setSearchTerm(suggestion);
                      setSuggestions([]);
                    }}
                  >
                    {suggestion}
                  </div>
                ))}
              </div>
            )}
          </div>
          <div className="flex gap-4">
            <button
              type="submit"
              className="flex-1 bg-nature-blue text-white py-3 rounded-lg hover:bg-blue-700 transition duration-200"
            >
              Rechercher
            </button>
            <button
              type="button"
              onClick={() => setShowWeather(true)}
              className="flex-1 bg-nature-green text-white py-3 rounded-lg hover:bg-green-700 transition duration-200"
            >
              Voir la météo
            </button>
          </div>
        </form>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8 mb-12">
        {modules.map((module, index) => (
          <ModuleCard key={index} {...module} />
        ))}
      </div>

      {showWeather && (
        <WeatherModal onClose={() => setShowWeather(false)} />
      )}
    </div>
  );
};

export default Home;
